/* eslint-disable no-unused-vars */
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Axios from 'axios';

function CreateEvent()
{
    // Used to Navigate to the different Pages
    const navigate = useNavigate();

    // Info used for the registering of a new event
    const [eventNameReg, setEventNameReg] = useState('');
    const [categoryReg, setCategoryReg] = useState('');
    const [descriptionReg, setDescriptionReg] = useState('');
    const [timeReg, setTimeReg] = useState('');
    const [LatitudeReg, setLatitude] = useState('');
    const [LongitudeReg, setLongitudeReg] = useState('');
    const [phoneNumReg, setPhoneNumReg] = useState('');
    const [contactEmailReg, setContactEmailReg] = useState('');
    const [] = useState('');
    const [,] = useState('');
    const [,] = useState('');
    


    return (
        <div>
            <h1>CREATE EVENT PAGE</h1>
            <div className='inputField'>
                <div>
                    <label>Event Name</label>
                    <input></input>
                </div>
                <div>
                    <label>Category</label>
                    <input></input>
                </div>
                <div>
                    <label>Description</label>
                    <input></input>
                </div>
                <div>
                    <label>Time</label>
                    <input></input>
                </div>
                <div>
                    <label>Latitude</label>
                    <input></input>
                </div>
                <div>
                    <label>Longitude</label>
                    <input></input>
                </div>
                <div>
                    <label>Contact Phone Number</label>
                    <input></input>
                </div>
                <div>
                    <label>Contact Email</label>
                    <input></input>
                </div>
                <div>
                    <label>Host RSO</label>
                    <input></input>
                </div>
                <div>
                    <label>Event Access:</label>
                    <selct name='availability'>
                        
                        <option value='0'>Private</option>
                        <option value='1'>Public</option>
                    </selct>
                </div>
            </div>  
        </div>
    );
}

export default CreateEvent;
